import React from 'react';
import { Link } from 'react-router-dom';
import './NavigationBar.css'; // Importa el archivo de estilos CSS
import logo from '../imagenes/prowess-logo1.png'; // Importa la imagen del logo y especifica la ruta correcta
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faUser, faShoppingCart } from '@fortawesome/free-solid-svg-icons';

function NavigationBar() {
  return (
    <nav className="navigation-bar">
      <div className='navigation-container'>
        <div className='logo'> 
          <img src={logo} alt="Logo" />
        </div>  
        <ul className="navigation-list">
          <li><Link to="/mi-cuenta"><FontAwesomeIcon icon={faUser} /></Link></li>
          <li><Link to="/carrito"><FontAwesomeIcon icon={faShoppingCart} /></Link></li>
        </ul>
      </div>
    </nav>
  );
}

export default NavigationBar;
